INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 4, 110501, "2019/07/31 12:00:00", 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 4, 24015, 1, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 1, 110501, "2019/07/31 12:00:00", 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 4.0, 4, 24016, 2, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 4, 110501, "2019/07/31 12:00:00", 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 4, 24017, 3, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 2, 110501, "2019/07/31 12:00:00", 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", "カオリ（サマー）", 5.2, 1, 24018, 4, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 6, 110501, "2019/07/31 12:00:00", 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", "カオリ（サマー）", 4.2, 5, 24019, 5, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 2, 110501, "2019/07/31 12:00:00", 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 2, 24020, 6, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 6, 110501, "2019/07/31 12:00:00", 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", "カオリ（サマー）", 6.4, 1, 24021, 7, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 2, 110501, "2019/07/31 12:00:00", 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 2, 24022, 8, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 3, 110501, "2019/07/31 12:00:00", 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", "カオリ（サマー）", 10.08, 6, 24023, 9, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 2, 110501, "2019/07/31 12:00:00", 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", "カオリ（サマー）", 5.0, 1, 24024, 10, 0.0);
INSERT INTO `v1_7424d1c3dd8154c93ccba665ccf4a06531cc14cbbec7a6c98c6bdf19a7dfbdb6` VALUES (10021, 0.0, 2, 110501, "2019/07/31 12:00:00", 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 2, 24025, 11, 0.0);
